const OPEN_CURLY = "{";
const CLOSE_CURLY = "}";

const skills = ["Python"];

function SkillsAndInterests() {
    return (
        <div className="skills-and-interests">
            <span className="Keyword">public</span> <span className="Keyword-2">String</span>[] <span className="Method-Class">getSkillAndInterests</span>() {OPEN_CURLY}<br/>
            &emsp;&emsp;&emsp;&emsp;<span className="Keyword">public</span> <span className="Keyword-2">String</span>[] languages <span className="Keyword">=</span> [ 
                {
                    skills.map((skill, i) => {
                        return (
                            <>
                            <span className="String">"{skill}"</span>
                            {(i != skills.length ) && <>,</>}
                            </>
                        );
                    })
                }
            ]
        </div>
    );
}

export default SkillsAndInterests;
